import { View, Text, FlatList } from "react-native";

import { MEALS } from "../data/dummy-data";

const MealsScreen = (props) => {
    return (
        <View>
            <FlatList
                data={MEALS}
                renderItem={(item) => <Text>item.item.title</Text>}
            />
        </View>
    );
};

export default MealsScreen;
